import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from "react";
import MapView from './components/MapView';
import Axios from "axios";

function App() {
  useEffect(() => {
    Axios.get('http://localhost:3001/api/get').then((response) => {
      console.log(response);
    })
  }, [])
  return (
    <div className="App">
      <MapView/>
    </div>
  );
}

export default App;
